Обязанности:
Составление и контроль за подписанием актов выполненных работ (Ф-2), справок о стоимости выполненных работ (КС-3) по договорам подряда на строительно-монтажные работы и списание материалов (М-29);
Проверка соответствия объемов строительно-монтажных работ, а также конструкций утвержденной проектно-сметной документации, рабочим чертежам, строительным нормам и правилам, стандартам, техническим условиям, нормам охраны труда;
Участие в рассмотрении и согласовании возникающих в ходе строительства изменений проектных решений, оперативное решение вопросов по замене, при необходимости, материалов, изделий, конструкций (без снижения качества строительных объектов);
Ведение учета законченных строительно-монтажных работ и подготовка необходимых данных для составления отчетности о выполнении планов строительства;
Осуществление проверки сметной документации на строительство объектов, расчет стоимости, учет выполненных работ;
Составление сметной документации на основе дефектных ведомостей и объемов работ.
Требования:
Высшее техническое образование;
Знание законодательства и иных нормативно-правовых актов, регулирующих деятельность строительных организаций;
Стаж работы Инженером ПТО/ инженером-сметчиком в строительной компании от 7 лет;
Отличные знания программ: Sana, ABC, AutoCad, умение составлять сметы ресурсным и др. методами, умение работать с чертежами и рабочими проектами
Условия:

Ежемесячная зарплата от 600,000 до 700,000 на руки в зависимости от навыков кандидатов;
Рабочая неделя с Пн по Пт, с 09.00 до 18.00;
Редкие командировки не более 1 раза в месяц.

Обязанности:

Осуществление технической экспертизы проекта;
Ведение накопительных ведомостей объемов выполненных работ;
Выборка материалов по объекту и составление заявки;
Сверка соответствия выполненных работ утвержденной ПСД, рабочим чертежам, строительным нормам;
Проверка списания использованных основных строительных материалов по форме М-29;
Контроль над выполнением субподрядными организациями (объемы, качество, сроки, ценовая политика);
Проверка исполнительной документации;
Составление технического задания;
Ведение исполнительно-технической документации.
Требования:
Высшее образование;
Знание систем ЭЛ, ЭО;
Работа инженером электриком.
Условия:
График работы 5/2;
Корпоративный английский язык;
Развозка;
Добровольное медицинское страхование после 6 месяцев;
Повышение квалификации за счет Компании.
